import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";
import styles from "./NavBar.module.css";

const NavBar = () => {
  //     let dataAos = data-aos
  //   const [linkStyle, setLinkStyle] = useState( {data-aos: "fade-right"} );
  const mouseHoverBlue = (event) => {
    event.target.style.background = "cyan";
    event.target.style.transition = "background 2s";
    event.target.style.border = "red";

    console.log("Hovering!");
  };
  const mouseHoverGreen = (event) => {
    event.target.style.background = "green";
    event.target.style.transition = "background 2s";
    event.target.style.border = "red";

    console.log("Hovering!");
  };
  const mouseExit = (event) => {
    console.log("Exited!");
    event.target.style.background = "";
  };

  return (
    <header className={styles.navbar}>
      <nav>
        <ul>
          <li>
            <NavLink
              activeClassName={styles.active}
              to="/planets"
              onMouseEnter={mouseHoverBlue}
              onMouseLeave={mouseExit}
              data-aos=""
            >
              Planets
            </NavLink>
          </li>
          <li>
            <NavLink
              activeClassName={styles.active}
              to="/characters"

              onMouseEnter={mouseHoverGreen}
              onMouseLeave={mouseExit}
            >
              Characters
            </NavLink>
          </li>
          <li>
            <NavLink
              activeClassName={styles.active}
              to="/starships"
            >
              Starships
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
